import React from 'react';
import './ImageGallery.css';

const SERVICES = [
  { title: 'Löpande bokföring', text: 'Genom att låta oss sköta er löpande bokföring ökar trygghet och kontroll.' , color: 'peach' },
  { title: 'Bokslut & deklaration', text: 'Vi hjälper med bokslut, deklaration och rapportering till myndigheter.' , color: 'mint' },
  { title: 'Ekonomisk förvaltning', text: 'Vi sköter den ekonomiska förvaltningen åt bostadsrättsföreningar och fastighetsägare.' , color: 'peach' },
  { title: 'Löneadministration', text: 'Outsourca löneadministrationen för trygg och korrekt hantering.' , color: 'mint' },
  { title: 'Rådgivning', text: 'Ekonomisk rådgivning, skatt och HR-frågor med snabbt svar.' , color: 'steel' },
  { title: 'Specialuppdrag', text: 'Projektstöd, systemmigreringar och skräddarsydda lösningar.' , color: 'steel' },
];

export default function ImageGallery(){
  return (
    <section className="services-grid" aria-labelledby="services-heading">
      <div className="services-inner">
        <div className="services-header">
          <h2 id="services-heading">Vad kan vi erbjuda dig som kund</h2>
          <a className="services-link" href="/tjanster">Läs om våra tjänster här <span aria-hidden>→</span></a>
        </div>

        <div className="tiles">
          {SERVICES.map((s, i) => (
            <article key={i} className={`tile tile-${s.color}`}>
              <div className="tile-inner">
                <small className="tile-kicker">{s.title.toUpperCase()}</small>
                <h3 className="tile-title">{s.title}</h3>
                <p className="tile-text">{s.text}</p>
                <a className="tile-cta" href="/tjanster">Läs mer här <span aria-hidden>→</span></a>
              </div>
            </article>
          ))}
        </div>
      </div>
    </section>
  );
}
